import { forwardRef } from 'react';

function OnSlideWindow({ text }, ref) {
  return (
    <div className="w-full h-screen bg-[#C48B5B]">
      <h2 className="flex justify-center items-center" ref={ref}>
        {text}
      </h2>
    </div>
  );
}

export default forwardRef(OnSlideWindow);
